import './App.css';
import Cards from './Components/Cards';
import Nav from './Components/Nav';
import SideBar from './Components/SideBar';
import {FlexWrapper} from './Components/Styled';

function App() {
  return (
    <div className="App">
      <Nav />
      <FlexWrapper>
        <SideBar />
        <Cards />
      </FlexWrapper>
    </div>
  );
}

export default App;
